function createFingerDataJSON() {
  const fingerData = {};

  // Create the JSON structure for 1000 finger IDs with "OUT" status
  for (let i = 1; i <= 1000; i++) {
    fingerData[i] = { status: "OUT" };
  }

  // Convert the data to a JSON string
  const jsonData = JSON.stringify(fingerData, null, 2);

  // Specify the file path
  const filePath = 'fingerData.json';

  // Write the JSON data to a file
  fs.writeFileSync(filePath, jsonData);

  console.log("JSON file 'fingerData.json' created.");
}

